import { StyleSheet } from "react-native";

const todayWorkoutStyles = StyleSheet.create({
    addExcerciseButton: {
        flexDirection: "row",
        backgroundColor: "#26547c",
        marginTop: 20,
        borderRadius: 5,
        paddingVertical: 5,
        paddingHorizontal: 15,
        alignItems: "center"
    },
    addExcerciseButtonText: {
        color: "#ffffff",
        marginLeft: 10,
        fontSize: 20
    },
    dateNavigation: {
        flex: 1,
        justifyContent: "space-between",
        color: "#ffffff",
        flexDirection: "row",
        alignItems: "center"
    },
    dateNavigationText: {
        color: "#ffffff",
        fontSize: 16
    }
});

export default todayWorkoutStyles;
